											dataViews.push({id:"id-2127dba515f949089eebf5465953bff6", type:"ArchimateDiagramModel", name:decodeURL("Implementation+and+Migration+Viewpoint"), documentation:decodeURL("The+implementation+and+migration+viewpoint+is+used+to+relate+programs+and+projects+to+the+parts+of+the+architecture+that+they+implement.+This+view+allows+modeling+of+the+scope+of+programs%2C+projects%2C+and+project+activities+in+terms+of+the+plateaus+that+are+realized+or+the+individual+architecture+elements+that+are+affected.+In+addition%2C+the+way+the+elements+are+affected+may+be+indicated+by+annotating+the+relationships.%0D%0A%0D%0AFurthermore%2C+this+viewpoint+can+be+used+in+combination+with+the+programs+and+projects+viewpoint+to+support+portfolio+management%3A%0D%0A%0D%0AThe+programs+and+projects+viewpoint+is+suited+to+relate+business+goals+to+programs+and+projects%0D%0A%0D%0AFor+example%2C+this+makes+it+possible+to+analyze+at+a+high+level+whether+all+business+goals+are+covered+sufficiently+by+the+current+portfolio%28s%29.%0D%0A%0D%0AThe+implementation+and+migration+viewpoint+is+suited+to+relate+business+goals+%28and+requirements%29+via+programs+and+projects+to+%28parts+of%29+the+architecture%0D%0A%0D%0AFor+example%2C+this+makes+it+possible+to+analyze+potential+overlap+between+project+activities+or+to+analyze+the+consistency+between+project+dependencies+and+dependencies+among+plateaus+or+architecture+elements.")});

											dataViews.push({id:"id-46ab2217c6b44c99aac1bad60a63c20e", type:"ArchimateDiagramModel", name:decodeURL("Project+Viewpoint"), documentation:decodeURL("A+project+viewpoint+is+primarily+used+to+model+the+management+of+architecture+change.+The+%E2%80%9Carchitecture%E2%80%9D+of+the+migration+process+from+an+old+situation+%28current+state+Enterprise+Architecture%29+to+a+new+desired+situation+%28target+state+Enterprise+Architecture%29+has+significant+consequences+on+the+medium+and+long-term+growth+strategy+and+the+subsequent+decision-making+process.+Some+of+the+issues+that+should+be+addressed+by+the+models+designed+in+this+viewpoint+are%3A%0D%0A%0D%0ADeveloping+a+fully-fledged+organization-wide+Enterprise+Architecture+is+a+task+that+may+require+several+years%0D%0A%0D%0AAll+systems+and+services+must+remain+operational+regardless+of+the+presumed+modifications+and+changes+of+the+Enterprise+Architecture+during+the+change+process%0D%0A%0D%0AThe+change+process+may+have+to+deal+with+immature+technology+standards+%28e.g.%2C+messaging%2C+security%2C+data%2C+etc.%29%0D%0A%0D%0AThe+change+has+serious+consequences+for+the+personnel%2C+culture%2C+way+of+working%2C+and+organization%0D%0A%0D%0AFurthermore%2C+there+are+several+other+governance+aspects+that+might+constrain+the+transformation+process%2C+such+as+internal+and+external+cooperation%2C+project+portfolio+management%2C+project+management+%28deliverables%2C+goals%2C+etc.%29%2C+plateau+planning%2C+financial+and+legal+aspects%2C+etc.")});
